import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import CampList from '/c';

const Home = () => <h1>Welcome to Campground Manager</h1>;

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/campgrounds">Manage Campgrounds</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/campgrounds" element={<CampList />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
